import axios from "axios";

const axios_instance = axios.create({
    baseURL: " http://localhost:8082/"
});


export const getFiles = () => {
    axios_instance.get("/CreateFolder", {headers: {
        "Access-Control-Allow-Origin": "*"
    }}).then(res => {
        console.log(res);
    }).catch(e => {
        console.log(e);
    });
}
